(function(){const i=1e3;let r=moment.utc($("#end-time-id-for-calculator").val()),u=moment.utc($("#start-time-id-for-calculator").val()),t=moment(),n;if(u>t){let i=moment.utc(u).local();n=moment.duration(i.diff(t))}else{let i=moment.utc(moment(r)).local();n=moment.duration(i.diff(t))}let f=$("#identifier").val();setInterval(function(){f!==null&&(n=moment.duration(n-i,"milliseconds"),n<0&&r>t&&location.reload(),$("#countdown").text(`${n.asDays().toFixed()}d ${n.hours()}h ${n.minutes()}m ${n.seconds()}s`))},i)})();